import { render } from '@testing-library/react';
import React, { useState } from 'react';
import Counter from './counter';

const Nav = () => {
    const [page, setPage] = useState(<Counter></Counter>);

    return (
        <div>
            <div>
                <button style="display: inline-block" onClick={() => setPage( <Counter></Counter> )}>ex1</button>
                <button style="display: inline-block" onClick={() => setPage( <p>hello</p> )}>test</button>
            </div>
            {page}
        </div>
    )
}

export default Nav;
